  const productIds = useSelector((state) => state.hostel.productIds)
  useEffect(() => { 
   const productList=productIds
  }, [productIds]);

  return (
    <Container fixed> 
      <div style={{ marginTop: 20 }}> 
        <Box fontSize={24} fontWeight={700}>
          Booking List
        </Box>
        {productIds.map((productid) => {
           <BookDetail id={ productid}/>
        })}

        </div>
    </Container>
  );
}
